) %>% \n","    factor(levels = c(\"Female\", \"Male\"))\n","  list(method = \"Height cutoff\",\n","       recall = sensitivity(y_hat, test_set$sex),\n","    precision = precision(y_hat, test_set$sex))\n","})\n","\n","bind_rows(guessing, height_cutoff) %>%\n","  ggplot(aes(recall, precision, color = method)) +\n","  geom_line() +\n","  geom_point()\n","guessing <- map_df(probs, function(p){\n","  y_hat <- sample(c(\"Male\", \"Female\"), length(test_index), replace = TRUE, \n","                  prob=c(p, 1-p)) %>% \n","    factor(levels = c(\"Male\", \"Female\"))\n","  list(method = \"Guess\",\n","    recall = sensitivity(y_hat, relevel(test_set$sex, \"Male\", \"Female\")),\n","    precision = precision(y_hat, relevel(test_set$sex, \"Male\", \"Female\")))\n","})\n","\n","height_cutoff <- map_df(cutoffs, function(x){\n","  y_hat <- ifelse(test_set$height > x, \"Male\", \"Female\") %>% \n","    factor(levels = c(\"Male\", \"Female\"))\n","  list(method = \"Height cutoff\",\n","       recall = sensitivity(y_hat, relevel(test_set$sex, \"Male\", \"Female\")),\n","    precision = precision(y_hat, relevel(test_set$sex, \"Male\", \"Female\")))\n","})\n","bind_rows(guessing, height_cutoff) %>%\n","  ggplot(aes(recall, precision, color = method)) +\n","  geom_line() +\n","  geom_point()"]},{"cell_type":"markdown","id":"9ce868bb","metadata":{"papermill":{"duration":0.046662,"end_time":"2022-07-14T07:48:33.818277","exception":false,"start_time":"2022-07-14T07:48:33.771615","status":"completed"},"tags":[]},"source":["### Exercise:\n","The reported_heights and heights datasets were collected from three classes taught in the Departments of Computer Science and Biostatistics, as well as remotely through the Extension School. The Biostatistics class was taught in 2016 along with an online version offered by the Extension School. On 2016-01-25 at 8:15 AM, during one of the lectures, the instructors asked student to fill in the sex and height questionnaire that populated the reported_heights dataset. The online students filled out the survey during the next few days, after the lecture was posted online. We can use this insight to define a variable which we will call type, to denote the type of student, inclass or online.\n","\n","The code below sets up the dataset for you to analyze in the following exercises:"]},{"cell_type":"code","execution_count":13,"id":"b052d365","metadata":{"execution":{"iopub.execute_input":"2022-07-14T07:48:33.911361Z","iopub.status.busy":"2022-07-14T07:48:33.909837Z","iopub.status.idle":"2022-07-14T07:48:34.058702Z","shell.execute_reply":"2022-07-14T07:48:34.056965Z"},"papermill":{"duration":0.198455,"end_time":"2022-07-14T07:48:34.061022","exception":false,"start_time":"2022-07-14T07:48:33.862567","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}],"source":["library(dslabs)\n","library(dplyr)\n","library(lubridate)\n","data(reported_heights)\n","\n","dat <- mutate(reported_heights, date_time = ymd_hms(time_stamp)) %>%\n","  filter(date_time >= make_date(2016, 01, 25) & date_time < make_date(2016, 02, 1)) %>%\n","  mutate(type = ifelse(day(date_time) == 25 & hour(date_time) == 8 & between(minute(date_time), 15, 30), \"inclass\",\"online\")) %>%\n","  select(sex, type)\n","\n","y <- factor(dat$sex, c(\"Female\", \"Male\"))\n","x <- dat$type\n"]},{"cell_type":"markdown","id":"6ffc0836","metadata":{"execution":{"iopub.execute_input":"2022-07-14T07:32:34.99355Z","iopub.status.busy":"2022-07-14T07:32:34.990746Z","iopub.status.idle":"2022-07-14T07:32:35.019681Z"},"papermill":{"duration":0.054485,"end_time":"2022-07-14T07:48:34.161751","exception":false,"start_time":"2022-07-14T07:48:34.107266","status":"completed"},"tags":[]},"source":["1. The type column of dat indicates whether students took classes in person (\"inclass\